import { Title } from "../Components.js";
import { LoadJSON } from "../DataHandler.js";
import "./CSS/Kontakt.css";

export default function Kontakt(){
    document.title = "FBG Bremen - Kontakt";

    let contactData = LoadJSON("Data/kontaktdaten.json");
    if(contactData === undefined) return;

    return (
        <>
            <Title title="Kontakt"/>
            
            <Form/>
        </>
    );
}

function Form(){
    return(
        <form className="form">
            <Addressee/>

            <Sender/>
            
            <input type="submit"/>
        </form>
    );
}

function Addressee(){
    return(
        <>
            <label for="addressat-dropdown" className="form-label">Addressat:</label>

            <select name="addressat-dropdown" id="addressat-dropdown" className="addressee-dropdown">
                <option value="unbestimmt">Unbestimmt</option>
                <option value="vorstand">Vorstand</option>
                <option value="aelteste">Ã„lteste</option>
                <option value="technik">Technik</option>
            </select>
        </>
    );
}

function Sender(){
    return(
        <>
            <label for="sender-inp" className="form-label">E-Mail: </label>

            <input type="email" className="sender-input" required></input>
        </>
    );
}
